window.bookSummaryJSON = "<p><b>The only novel ever to win the Hugo, Nebula, and Arthur C. Clarke awards and the first audiobook in Ann Leckie's </b><b><i>New York Times</i></b><b> best-selling trilogy. </b></p> <p>On a remote, icy planet, the soldier known as Breq is drawing closer to completing her quest.</p> <p>Once, she was the <i>Justice of Toren</i> - a colossal starship with an artificial intelligence linking thousands of soldiers in the service of the Radch, the empire that conquered the galaxy.&nbsp;</p> <p>Now, an act of treachery has ripped it all away, leaving her with one fragile human body, unanswered questions, and a burning desire for vengeance.&nbsp;</p> <p><b>In the Ancillary world: </b></p> <p></p> <ol> <li><i>Ancillary Justice</i></li> <li><i>Ancillary Sword</i></li> <li><i>Ancillary Mercy</i></li> </ol> <p><b>For more from Ann Leckie, check out:</b></p> <p><i>Provenance</i></p>"; 
